B.EI=new A.da("System Select","Whether you are closing the gap of technical debt, unifying your transaction processing & master data to leverage your data as an asset, or looking to maximize your IT investment, R-CUBED enables you to select the right fit-for-purpose solutions. We specialize in business ready applications across Enterprise Resource Planning, Corporate Performance Management, Enterprise Analytics, and Human Capital Management.",null)
B.EJ=new A.da("Enterprise Analytics","R-CUBED delivers real data-driven enterprise decision capability using holistic analytic strategies and resilient architecture. We help you deploy an agile analytics model to make well informed data-backed decisions that strengthen business results. We specialize in Human Capital Management, Supply Chain Management and Finance Analytics.",null)
B.EK=new A.da("Operations Management","R-CUBED puts the user experience at the center of our unified support delivery model. We measure our success on user experience. R-CUBED is proactively responsive, attentive to priority, and mindful of cycle times throughout the service request lifecycle. We are seasoned domain and product experts offering 24x7x365 service.",null)
B.EL=new A.da("System Diagnostic Strategy","Let R-CUBED baseline your current application landscape and position opportunities and considerations for modernization. We will team with you to develop a business case and time-phased strategic roadmap to migrate and/or enhance your enterprise application footprint aligning to operational strategy and initiatives.",null)
B.EM=new A.da("Cloud Strategy & Road Map","Let\u2019s shape your cloud value path strategy and \u2018must have\u2019 milestones. Are you ready to move to the cloud and capitalize on reducing technical debt, data modernization, quicker scalability, greater agility, better use of IT resources, and enhanced data security? R-CUBED will team with you to build the right cloud migration roadmap and time-phased modernization plan.",null)
B.EN=new A.da("Resilient Architecture","We understand that agility, performance, and data quality are critical to business success and sustainability.R-CUBED\u2019s integration design methodology constructs a foundation that is scalable, supportable, and reusable. Let\u2019s work together to realize these benefits today & be ready for tomorrow\u2019s demands.",null)
B.EO=new A.da("Corporate Performance Management","R-CUBED\u2019s digital enablement model and methods unleash business performance management eliminating data silos, sunsetting manual spreadsheets, and re-directs focus on critical analysis and decision making. Our experience with extensible CPM platforms enables extended planning and analysis (xP&A) for unified, on-demand financial planning, forecasting, modeling, and operations planning across lines of business as a collaborative process. We help organizations focus on what matters with nimbleness, simplification, and increase speed-to-value across Finance, Supply Chain &amp; Customer Experience.",null)
